import React from "react";

interface FontBoxProps {
    fontName: string;
    previewText: string;
}

export const FontBox: React.FC<FontBoxProps> = ({ fontName, previewText }) => {
    return (
        <div>
        <h2 className={`text-sm font-light mb-2 ${fontName}`}>{fontName}</h2>
            <div>
                {previewText}
            </div>
        </div>
    );
};
